<?php

function catchPokemon($str) {
	$directions = str_split($str);
	$trek['0,0'] = '0,0';
	$count = 1;

	$actual = key($trek);
	
	foreach ($directions as $i => $value) {
		$lat = (int) explode(',', $actual)[0];
		$lon = (int) explode(',', $actual)[1];

		switch ($value) {
			case 'N':
				$lat -= 1;
			break;

			case 'S':
				$lat += 1;
			break;
			
			case 'E':
				$lon -= 1; 
			break;
			
			case 'O':
				$lon += 1; 
			break;
			
			default: 
				continue;
		}

		$actual = "$lat,$lon";

		if (!isset($trek[$actual])) {
			$trek[$actual] = $actual;
			$count++;
		}
	}

	return $count;
}

var_dump(catchPokemon('
